import { Switch, Route } from 'react-router-dom';
import Home from './pages/home/Home';
import './App.css';

function App() {
    return (
        <div className="App">
            <Switch>
                <Route exact path="/" component={Home} />
            </Switch>
        </div>
    );
};

export default App;

